import React, { useEffect, useState } from 'react';
import api from './api/posts';

function App() {
  const [posts, setPosts] = useState([])



  useEffect(() => {
    const fetchPosts = async () => {
      try {
        const responce = await api.get('/locations/units/map/simple')
        setPosts(responce.data)
      }
      catch (err) {
        if (err.responce) {
        console.log(err.responce.data)
        console.log(err.responce.status)
        console.log(err.responce.headers)
      }
      else {
        console.log(err.message)
      }
    }
    }

    fetchPosts()
  }, [])

  console.log(posts)

  return (
    <div>
      {/* <div
        className="block max-w-md p-6 bg-white border border-gray-200 
