      > */}
        <h1>Posts</h1>
        {posts.map((post) => (
          <div className="  max-w-lg p-6 bg-white border border-gray-200 
      rounded-lg shadow hover:bg-gray-100 dark:bg-gray-800 dark:border-gray-700 dark:hover:bg-gray-700">
              <p className="text-red-500 font-bold">{post.lat}</p>
              <h3 className="text-indigo-300 font-bold">{post.lon}</h3>
              <p className="text-indigo-600 font-bold">{post.location}</p>
              <p className="text-indigo-900 font-bold">{post.link}</p>

          </div>
        ))}
      </div>
    // </div>
  );
}

export default App;
